      <TouchableOpacity 
    		onPress={() => navigation.navigate('Colors')}
       >
			<Image source={colors} 
				style={styles.smallButtons}
			/>
      </TouchableOpacity> 

      <Text>Colors</Text>

    </View>

    </View>
  );
}


//Aplhabet Screen


function AlphabetScreen({ navigation }) {
  return (
    <View style={{ flex: 1 }}>
    	<ScrollView>
    	<View style={styles.horizontalContainer}>
    		<ScrollView horizontal={true}>
		      <TouchableOpacity 
		    		onPress={this.A}
		       >
