					</View>
	 		        </TouchableOpacity>

	 		    </View>

	 		    <View style={styles.container2}>

					<TouchableOpacity 
			    		onPress={() => navigation.navigate('Planets')}
			        >
						<Image source={jupiter} 
						style={styles.smallButtons2}
						/>
					<View style={styles.names2}>
						<Text>Jupiter</Text>
					</View>
	 		        </TouchableOpacity>

	 		        <TouchableOpacity 
			    		onPress={() => navigation.navigate('Planets')}
			        >
						<Image source={saturn} 
						style={styles.smallButtons2}
						/>
					<View style={styles.names2}>
						<Text>Saturn</Text>
					</View>
	 		        </TouchableOpacity> 

	 		        <TouchableOpacity 
			    		onPress={() => navigation.navigate('Planets')}
			        >
						<Image source={uranus} 
						style={styles.smallButtons2}
						/>
					<View style={styles.names2}>
						<Text>Uranus</Text>
					</View>
	 		        </TouchableOpacity> 

	 		        <TouchableOpacity 
			    		onPress={() => navigation.navigate('Planets')}
			        >
						<Image source={neptune} 
						style={styles.smallButtons2}
						/>
					<View style={styles.names2}>
						<Text>Neptune</Text>
					</View>
	 		        </TouchableOpacity> 

	 		    </View>

		</View>
		</ScrollView>
    </View>
  );
}


